('2334','23','6093','Hotel Hilton',Null,'Landhotel der Luxusklasse Nähe Palma de Mallorca zu verkaufen','32922','Dieses Luxushotel mit 89 Zimmern steht auf einem ca 200.000m² großen Grundstück. In wenigen Fahrminuten erreicht man zwei 18 Loch Golfplätze und das Meer. Zum Flughafen sind es nur 10 Fahrminuten. Die absolute ruhige Lage (kein Fluglärm) und die gute Anbindung nach Palma macht dieses Hotel zu einem sehr begehrten Urlaubsdomizil für verwöhnte Hotelgäste. Außer seinen großzügig gestalteten Zimmern und Suiten (40m² bis 90m²) bietet das Hotel auch noch einen edlen Spabereich, ein Gourmet Restaurant, ein Familienpool, ein Erwachsenen Pool, ein Kinderpool, zwei Tennisplätze und über 1000m² Tagungsräume. \r\nFür weitere Infos benötigen wir einen Bonitätsnachweis und einen unterschriebenen LOI den wir Ihnen gerne zusenden\r\n','32923','26600000','106','2015-05-18 14:11:06','106','2015-05-18 14:11:45',Null,'2395','105','1126',1,'1','0',Null,Null,'Preis auf Anfrage','32924',Null,'0','0','0',Null,'2015-05-18 14:15:48',1,'0',Null,Null,Null,Null,'5',1,1,1,'0','1','1',1,1,Null,'32925',Null,'32926',Null,'32927',Null,'32928','Sebastian Lodder, Sohn. slodder@t3hotels.com.','32929','0',0,'0');
